import React, {Components} from 'react'
import {Nav} from 'react-bootstrap'
import PRODUCTS from '../products';

class Left extends React.Component{
    render(){
      //const clothesCount = PRODUCTS.filter(item => item.category = 'Clothes')
      return(
        <div> 
          <Nav defaultActiveKey="/home" className="flex-column">
            <Nav.Link href="/" style={{color: "#555B6E"}}>All Products ({Object.values.PRODUCTS.length})</Nav.Link>
            {/* <Nav.Link href="/about" style={{color: "#555B6E"}}>Clothes({Object.values.clothesCount.length})</Nav.Link> */}
            <Nav.Link href="/help" style={{color: "#555B6E"}}>Help</Nav.Link>
          </Nav>
        </div>
      )
    }
  }

export default Left;
